	render(){
		const friends = {'Alex': ['Bricco', 'Strega'], 'Emilio': ['Tbaar brookline', 'Mikes pastry']}
		const keys = Object.keys(friends);
	return (

		<div>
		<br></br>

		{keys.map( (item) => {
			<Grid columns={1}>
      		<Grid.Column>


  			<p>{item} updated his restaurant list</p>


			</Grid.Column>
			</Grid>
			friends[item].map( (place) => {
				console.log(place);

		})
		})}
		</div>

		);
}
}


export default Feed
